$(function () {
    serverTime.runTime();

    ImgManage();

    $("#testservertime").text(serverTime.getCurTime());

    if (navigator.geolocation) {
        navigator.geolocation.getCurrentPosition(showPosition);
    }
    ranking();
    var music = new Music();
    music.init();
    //擂台赛
    if (competition.isStart() == true) {
        if (intervalTimeSpan) {
            clearInterval(intervalTimeSpan);
        }
        if (competition.isdone() == true) {
            competition.done();
        } else {
            competition.doing();
        }
    } else {
        var intervalTimeSpan = setInterval(function () {
            competition.ready();
        }, 1000);
    }
    var intervalTimeSpan2 = setInterval(function () {
        if (competition.istimeover() == true) {
            competition.timeover();
        }
    }, 1000);
    competition.hideGame();
    playersNumber();
    //getAd();
})
function showPosition(position) {
    var longitude = position.coords.longitude;
    var latitude = position.coords.latitude;
    $.ajax({
        url: "../provide/baiduapi.ashx",
        type: "post",
        dataType: "text",
        async: false,
        data: "openid=" + $("#hfOpenid").val().replace(/\+/g, '%2B') + "&longitude=" + longitude + "&latitude=" + latitude,
        beforeSend: function () {
            //$("#processed").show();
        },
        complete: function () {
            //$("#processed").hide();
        },
        success: function (data) {
            if (data != "") {
                alert("发生意外错误！");
            }
        },
        error: function (XMLHttpRequest, textStatus, errorThrown) {
            alert(XMLHttpRequest.status);
            alert(XMLHttpRequest.readyState);
            alert(textStatus);
        }
    });
}
