var competition = {
    href: function () {
        var link = "";
        link = "competition/index.aspx?id=60&openid=" + $("#hfOpenid").val().replace(/\+/g, '%2B');
        return link;
    },
    historyhref: function () {
        var links = [];
        return links;
    },
    isStart: function () {
        var v = $("#hfStartDate").val();
        var time1 = new Date(v);
        var time2 = serverTime.getCurTime();
        var span = (time1.getTime() - time2.getTime()) / 1000;
        if (span < 0) {
            return true;
        } else {
            return false;
        }
    },
    ready: function () {
        var t = $("#hfStartDate").val();
        var time1 = new Date(t);
        var time2 = serverTime.getCurTime();

        var span = (time1.getTime() - time2.getTime()) / 1000;
        var h = Math.floor(span / 3600);
        var m = Math.floor((span % 3600) / 60);
        var s = Math.floor((span % 3600) % 60);
        if (span > 0) {
            var span2 = "距活动：" + h + "时" + m + "分" + s + "秒";
            $("#timespan").text(span2);
        } else {
            this.begin();
        }
    },
    begin: function () {
        $("#cover").css({ display: "none" });
        $("#timespan").text("");
    },
    isdone: function () {
        var t = $("#hfIsPartIn").val();
        if (t == "true") {
            return true;
        } else {
            return false;
        }
    },
    done: function () {
        $("#cover").css({ display: "block", width: "50%" });
        $("#timespan").text("欢迎下次再战");
        $("#btnPlay").text("活动完成").attr("href","javascript:void(0)");
    },
    doing: function () {
        $("#cover").css({ display: "none" });
        $("#timespan").text("");
    },
    istimeover: function () {
        var t = $("#hfEndDate").val();
        var time1 = new Date(t);
        var time2 = serverTime.getCurTime();
        var span = (time1.getTime() - time2.getTime()) / 1000;
        if (span > 0) {
            return false;
        } else {
            return true;
        }
    },
    timeover: function () {
        $("#cover").css({ display: "block", width: "50%" });
        $("#timespan").text("活动结束");
        $("#btnPlay").text("活动结束").attr("href", "javascript:void(0)");
    },
    hideGame: function () {
        var t1 = $("#hfStartDate").val();
        var t2 = $("#hfEndDate").val();
        if (t1 == "" && t2 == "") {
            $("#competition_help").css("display", "none");
            $("#munu_competition").css("display", "none");
        }
    }
};

function Music() {
    this.audio = document.getElementById('audio');
    this.init = function () {
        var filename = [
            "http://audio-10010590.file.myqcloud.com/4586.mp3"//4586.mp3
            ];
        var index = parseInt(Math.random());
        if ((navigator.userAgent.match(/iPhone/i) || navigator.userAgent.match(/iPod/i))) {
            // 判断系统版本号是否大于 4
            var t = Boolean(navigator.userAgent.match(/OS [8-9]_\d[_\d]* like Mac OS X/i));
            if (t == true) {
                this.play(filename[index]);
            }
        } else {
            this.play(filename[index]);
        }
    }
    this.play = function (src) {
        if (this.audio != null) {
            this.audio.src = src;
            this.audio.play();
        }
    };
}

