function getAd() {
    $.getJSON('../provide/index.ashx?method=ad', function (results) {
        if (results.Name != "") {
            $("#ad").show();
            var href = '';
            if (results.OuterLink != '') {
                href = results.OuterLink;
            } else {
                href = "adv.html?id="+results.ID;
            }
            var html = '<p >' +
		        '<img id=adImg src="' + results.ImgUrl + '" style="width:100%;margin-top:20px;" />' +
		        '<div style="font-size:16px;   background-color:rgba(255, 218, 178, 0.6) ;position:absolute;bottom:0px;padding:5px 10px; width:100%;">' +
                '<a style="color:#000;" href="' + href + '">' + results.Resume + '  点击详情>>></a></div>' +
		        '</p>';
            $("#ad").empty();
            $("#ad").append(html);
        } else {
            $("#ad").hide();
        }
    })
}


